import React from 'react';
import ReactDOM from 'react-dom/client';
import './index.css';
import App from './components/app';
import {
  BrowserRouter,
  Routes,
  Route,
} from "react-router-dom";

const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(
  <BrowserRouter>
    <Routes>
      <Route path="/" element={<App/>} />
      <Route path="/shop"  />
    </Routes>
  </BrowserRouter>
);
